import { InnerPagesTopTitle } from "../../components/common/InnerPagesTopTitle/InnerPagesTopTitle";
import { NavLink } from "react-router-dom";
export const Customer = () => {
  return (
    <>
      <div className="custom_container">
        <div className="inner_custom_container">
          <div className="user_managemen_top_title">
            <InnerPagesTopTitle name="User Management" />
          </div>
          <PageTopNav />
        </div>
      </div>
    </>
  );
};

const PageTopNav = () => {
  const PageTopNavListData = [
    {
      backgroundColor: "#3499ff",
      color: "white",
      name: "Customers",
      link: "/Customer",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Employees",
      link: "/",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Sub-contractor",
      link: "/",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Receptions",
      link: "/",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Referrers",
      link: "/",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Referrers",
      link: "/",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Referrers",
      link: "/",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Referrers",
      link: "/",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Referrers",
      link: "/",
    },
  ];
  const PageTopNavListApp = (props) => {
    return (
      <NavLink to="/">
        <div className="row">
          <div
            style={{
              backgroundColor: props.backgroundColor,
              color: props.color,
            }}
            className="col-12 page_top_nav_link"
          >
            {props.name}
          </div>
        </div>
      </NavLink>
    );
  };
  return (
    <>
      <div className="">
        <div className="page_top_nav">
          {PageTopNavListData.map((val, i) => {
            return <PageTopNavListApp key={i} {...val} />;
          })}
        </div>
      </div>
    </>
  );
};
